import React from 'react'
import home__logo from './PlanWAT.jpg'
import './Home.css'

function Home() {
    return (
        <div className='home__main'>
            {/* Tutaj okoduje czesc lewa */}
            <div className="home__leftSide"></div>
            <img src={home__logo} alt='zdj1' />
            {/* Tutaj okoduje czesc prawa */}
            <div className="home__rightSide"></div>
            <div className='home__rightSide__text'>
                <div className='home__title'>TYTUŁ PORTALU</div>
                <div className='home__subtitle'>podtytuł strony internetowej</div>
            </div>

            <button className='home_button'>WCHODZĘ</button>


        </div>
    )
}

export default Home
